@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'cibando';
}
<div class="container-titolo">
  <h2>App di esempio in Angular</h2>
  <p class="paragrafo">Ecco un paragrafo di testo</p>
</div>
